import axios from 'axios'
const Poll = async (data) => {
    return new Promise(async (resolve, reject) => {
      try {
        const response = await axios.post("http://localhost:3000/topic");
        resolve(response.data);
      } catch (err) {
        reject(err);
      }
    });
  };
export default Poll
